import React from 'react'
import { Layout, Card, Form, Input, Button } from 'antd';
const { Header, Footer, Content, Sider } = Layout;

const Upload = () => {
    return (
        <React.Fragment>
            <Layout>
                <Header></Header>
                <Layout>
                    <Sider>Sider</Sider>
                    <Content>Content</Content>
                </Layout>
                <Footer></Footer>
            </Layout>
        </React.Fragment>
    )
}

export default Upload
